import{_ as r}from"./plugin-vue_export-helper-c27b6911.js";import{o as i,c as n,a as o,b as e,d as a,e as s}from"./app-55dec57a.js";const h={},t=e("h1",{id:"个人简介",tabindex:"-1"},[e("a",{class:"header-anchor",href:"#个人简介","aria-hidden":"true"},"#"),a(" 个人简介")],-1),d=e("h2",{id:"一、个人优势",tabindex:"-1"},[e("a",{class:"header-anchor",href:"#一、个人优势","aria-hidden":"true"},"#"),a(" 一、个人优势")],-1),l=e("ol",null,[e("li",null,"8年Java开发经验，熟悉各主流开发框架，熟悉领域驱动设计及微服务系统架构。熟悉常用的设计模式，熟悉常用的数据结构和算法。"),e("li",null,"熟悉通用缓存/DB/搜索引擎/消息队列等中间件。对业内高可用高并发及分布式技术解决方案有充分理解。"),e("li",null,"具备DevOps系统设计经验，熟悉Jenkins、Gitlab、Maven、Docker等工具，熟悉Linux操作系统及各云平台。"),e("li",null,"具备较强的横向协作能力及团队管理能力，责任心强，工作以结果为导向。")],-1),c=s('<h2 id="二、工作经历" tabindex="-1"><a class="header-anchor" href="#二、工作经历" aria-hidden="true">#</a> 二、工作经历</h2><h3 id="_2-1-国泰新点软件股份有限公司" tabindex="-1"><a class="header-anchor" href="#_2-1-国泰新点软件股份有限公司" aria-hidden="true">#</a> 2.1 国泰新点软件股份有限公司</h3><blockquote><p>2022-01 ~ 至今 集成开发部 技术经理</p></blockquote><h4 id="_2-1-1-工作内容" tabindex="-1"><a class="header-anchor" href="#_2-1-1-工作内容" aria-hidden="true">#</a> <strong>2.1.1 工作内容</strong></h4><ol><li>担任技术经理，带领部门负责公司所有产品的落地部署架构设计工作，指导部署人员完成落地部署</li><li>负责向所有产品团队推广引入DevOps体系，通过CI/CD达到更快交付业务价值的目标，并持续打磨DevOps能力完善流程规范</li><li>负责对所有产品团队的研发产物进行UAT测试，采用了Ranorex、Junit、Jmeter、SonarQube等工具</li><li>负责搭建项目运维体系，通过docker容器管理技术实现项目上远程自动化更新方案，并负责推广至全公司600多个落地项目</li></ol><h4 id="_2-1-2-工作业绩" tabindex="-1"><a class="header-anchor" href="#_2-1-2-工作业绩" aria-hidden="true">#</a> <strong>2.1.2 工作业绩</strong></h4><ol><li>形成了完善的产品发版流程，提高了产品发版质量</li><li>形成了完善的项目部署流程，提高了项目部署配置质量</li></ol><h3 id="_2-2-国泰新点软件股份有限公司" tabindex="-1"><a class="header-anchor" href="#_2-2-国泰新点软件股份有限公司" aria-hidden="true">#</a> 2.2 国泰新点软件股份有限公司</h3><blockquote><p>2019-01 ~ 2021-12 架构设计部 架构师</p></blockquote><h4 id="_2-2-1-工作内容" tabindex="-1"><a class="header-anchor" href="#_2-2-1-工作内容" aria-hidden="true">#</a> <strong>2.2.1 工作内容</strong></h4><ol><li>担任架构师，参与设计了多个产品以及多个大型项目的架构设计</li><li>重点参与重构交易系统，运用领域驱动的设计理念，并对整个系统进行了微服务拆分成多个子系统。引入了nacos、apollo、seata、sentinel等中间件</li><li>负责搭建公司的DevOps体系，实现对公司所有产品的持续集成持续部署。采用了jenkins、gitlabrunner、maven、nexus、docker等工具</li><li>参与搭建公司的运维监控平台，实现对公司所有产品的运维监控。采用了prometheus、grafana等工具</li><li>协助项目上处理疑难问题及性能调优，采用jvm调优、MemoryAnalyzer、jstack、火焰图、数据库执行计划、慢sql监控等技术，并定期组织培训</li></ol><h4 id="_2-2-2-工作业绩" tabindex="-1"><a class="header-anchor" href="#_2-2-2-工作业绩" aria-hidden="true">#</a> <strong>2.2.2 工作业绩</strong></h4><ol><li>因业绩突出获得2020年度公司优秀员工</li><li>负责搭建的DevOps体系大幅提升了公司的研发效能，提高了产品的交付质量</li></ol><h3 id="_2-3-国泰新点软件股份有限公司" tabindex="-1"><a class="header-anchor" href="#_2-3-国泰新点软件股份有限公司" aria-hidden="true">#</a> 2.3 国泰新点软件股份有限公司</h3><blockquote><p>2014-09 ~ 2018-12 研发中心 Java开发工程师</p></blockquote><h4 id="_2-3-1-工作内容" tabindex="-1"><a class="header-anchor" href="#_2-3-1-工作内容" aria-hidden="true">#</a> <strong>2.3.1 工作内容</strong></h4><ol><li>参与多个大型项目的建设，如：青海省政务服务云平台、中国石化物资采购系统等，使用了spring、springmvc、springjpa、shiro、quartz等技术栈</li><li>参与多个产品开发工作，如：竞价系统、网上商城、档案系统、评标系统等，使用了nginx、rabbitmq、redis、mongodb、elasticsearch、solr等中间件，技术栈包括websocket、ehcache、线程池、分布式锁等</li><li>参与公司自研的开发框架的开发工作，如：基于springmvc的web框架、基于zuul的服务网关框架、基于springsecurity的统一认证框架等</li><li>负责搭建公司的财经分析系统，通过对数据的治理建立不同的分析模型，最终通过数据可视化的方式展示。使用了数据库CDC技术、xxl-job、echarts、antv等技术</li></ol><h4 id="_2-3-2-工作业绩" tabindex="-1"><a class="header-anchor" href="#_2-3-2-工作业绩" aria-hidden="true">#</a> <strong>2.3.2 工作业绩</strong></h4><ol><li>因业绩突出获得2016年度公司优秀员工</li><li>担任项目负责人的青海省政务服务云平台获得公司2017年度公司十大优秀项目</li></ol><h2 id="三、项目经历" tabindex="-1"><a class="header-anchor" href="#三、项目经历" aria-hidden="true">#</a> 三、项目经历</h2><h3 id="_3-1、搭建公司devops体系" tabindex="-1"><a class="header-anchor" href="#_3-1、搭建公司devops体系" aria-hidden="true">#</a> 3.1、搭建公司DevOps体系</h3><blockquote><p>2021-05 ~ 2022-12 架构师</p></blockquote><hr><h4 id="_3-1-1-工作内容" tabindex="-1"><a class="header-anchor" href="#_3-1-1-工作内容" aria-hidden="true">#</a> <strong>3.1.1 工作内容</strong></h4><p>集成开发平台是一款覆盖了从源码拉取到打包部署整个生命周期的质量效能云平台。结合目前业内流行的DevOps理念，更侧重于整个研发过程的标准化、各环节的工具链串联，通过CI/CD达到更快交付业务价值的目标。</p><p>技术栈：jenkins、jenkins pipeline、jenkins plugin、git、svn、maven、nexus、maven plugin、docker、junit、jacoco、sonarqube、springboot、mysql、redis、xxl-job等</p><h4 id="_3-1-2-工作业绩" tabindex="-1"><a class="header-anchor" href="#_3-1-2-工作业绩" aria-hidden="true">#</a> <strong>3.1.2 工作业绩</strong></h4><p>对整个公司研发效能实现了很大的提升，开发人员只需要关注代码的提交，通过devops实现部署包的自动构建并发布，实现了产品的持续集成持续部署，让开发人员只需关注代码而需要关注其他事情，从而提高了代码的质量。</p><h3 id="_3-2、产品微服务化重构" tabindex="-1"><a class="header-anchor" href="#_3-2、产品微服务化重构" aria-hidden="true">#</a> 3.2、产品微服务化重构</h3><blockquote><p>2021-01 ~ 2021-12 架构师</p></blockquote><h4 id="_3-2-1-工作内容" tabindex="-1"><a class="header-anchor" href="#_3-2-1-工作内容" aria-hidden="true">#</a> <strong>3.2.1 工作内容</strong></h4><p>采用领域驱动的设计理念对进行了重构，将业务的每个领域拆分成独立的组件，可快速插拔。每个组件代码分为四层结构，分别是仓储层、服务层，接口层和控制层。每个组件可独立部署，接入注册中心，通过openfeign调用远端实现，也可以单体部署调用本地实现。</p><p>技术栈：springboot、springcloud alibaba、nacos、seata、sentinel、openfeign、mysql、nginx、docker等。</p><h4 id="_3-2-2-工作业绩" tabindex="-1"><a class="header-anchor" href="#_3-2-2-工作业绩" aria-hidden="true">#</a> <strong>3.2.2 工作业绩</strong></h4><p>运用领域驱动的设计理念，把系统分割为一个个限界的上下文；通过实体、值对象、聚合等来处理领域的信息；通过服务和领域事件与其他领域耦合；通过上下文地图来表述系统的宏观结构；强调领域专家的作用；强调持续集成和演化。从结构上来看，又根据不同领域拆分成多个组件，各组件之间相互独立。从部署架构上来看看，各个组件可自由组合成一个独立运行的服务，通过注册中心进行服务注册和发现，通过openfeign调用远端服务，从而提高了系统的可用性和可靠性。也可以无需修改代码实现单体部署，调用本地实现，从而降低部署成本。</p><h3 id="_3-3-统一认证框架" tabindex="-1"><a class="header-anchor" href="#_3-3-统一认证框架" aria-hidden="true">#</a> 3.3 统一认证框架</h3><blockquote><p>2018-01 ~ 2018-12 Java开发工程师</p></blockquote><h4 id="_3-3-1-工作内容" tabindex="-1"><a class="header-anchor" href="#_3-3-1-工作内容" aria-hidden="true">#</a> <strong>3.3.1 工作内容</strong></h4><p>基于springsecurity的统一认证框架，实现了单点登录、权限控制、用户管理、角色管理、菜单管理等功能。支持多种登录方式，如：用户名密码登录、短信验证码登录等，基于框架可快速实现新登录方式。</p><p>技术栈：springboot、springsecurity、vue3、vue router、antdesign vue等。</p><h4 id="_3-3-2-工作业绩" tabindex="-1"><a class="header-anchor" href="#_3-3-2-工作业绩" aria-hidden="true">#</a> <strong>3.3.2 工作业绩</strong></h4><p>制定了公司产品的统一认证规范，提高了产品的安全性。基于框架可快速开发权限认证功能，提高了开发效率。</p><h3 id="_3-4、个人项目" tabindex="-1"><a class="header-anchor" href="#_3-4、个人项目" aria-hidden="true">#</a> 3.4、个人项目</h3><blockquote><p>2018-01 ~ 至今 全栈开发工程师</p></blockquote><h4 id="_6-1-工作内容" tabindex="-1"><a class="header-anchor" href="#_6-1-工作内容" aria-hidden="true">#</a> <strong>6.1 工作内容</strong></h4><ol><li>基于yolov5的目标检测实现人员车辆检测，使用TensorRT+deepstream加速，使用的技术栈有：c++、cmake、python、pytorch、CUDA、opencv、TensorRT、deepstream等</li><li>基于vben-admin的微信小程序后台管理系统，使用的技术栈有：vue3、vue router、vuex、typescript、antdesign vue、axios、mockjs、echarts等</li><li>基于vuepress的个人博客系统，主要为了分享自己的学习心得。并同步开通了微信公众号</li><li>基于c++和ffmpeg技术实现对爱奇艺视频文件的解密，同时使用了java进行了实现，并分享至了个人博客及微信公众号获得大量点赞</li><li>基于springboot开发的文档预览系统，支持多种文档格式的预览，如：pdf、doc、docx、xls、xlsx、ppt、pptx、txt等</li></ol><h4 id="_6-2-工作业绩" tabindex="-1"><a class="header-anchor" href="#_6-2-工作业绩" aria-hidden="true">#</a> <strong>6.2 工作业绩</strong></h4><p>通过个人项目提高了自己的技术能力。利用业余时间开发了个人博客系统，分享自己的学习心得，同时也开通了微信公众号，分享自己的学习心得，获得了很多的点赞和关注。</p>',48);function p(u,_){return i(),n("div",null,[t,d,l,o(" more "),c])}const x=r(h,[["render",p],["__file","intro.html.vue"]]);export{x as default};
